import '../../App.css';
import React from 'react';
import Footer from '../Footer';
import ContactForm from '../ContactForm';
import {Typography, Grid, Container, List, ListItem, ListItemText } from '@material-ui/core';
import   { makeStyles,createMuiTheme, responsiveFontSizes, ThemeProvider } from '@material-ui/core/styles';
import ArrowRightIcon from '@material-ui/icons/ArrowRight';
import ListItemIcon from "@material-ui/core/ListItemIcon";


const useStyles = makeStyles({
     root: {
          background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
          borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 30px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
     },
     label:{

     }
})

let theme = createMuiTheme();
theme = responsiveFontSizes(theme);


function Contact() {
     const classes = useStyles;
     const [dense, setDense] = React.useState(false);
	return (




		<div className="contact_container">
    <Grid container direction="row"
  justify="center"
  alignItems="center"
  style={{background: '#FFEFBA',
     background: '-webkit-linear-gradient(to right, #FFFFFF, #FFEFBA)',
     background: 'linear-gradient(to right, #FFFFFF, #FFEFBA)'}}
>

     <Grid item xs={6} style={{textAlign:'center'}}> 
     <ThemeProvider theme={theme}>

     <Typography gutterBottom style={{display:'inline-block'}} variant="h5"> Office Address:</Typography>

    <Typography gutterBottom style={{display:'inline-block', marginLeft:'5px'}} >C-689, Sarita Vihar, New Delhi 110076</Typography>
          <List dense={dense} style={{alignItems:'center'}}>
               <ListItem >
               <ListItemIcon>
                         <ArrowRightIcon/>
               </ListItemIcon>
                    <ListItemText>


                    <Typography > Get Project's Budget Estimate</Typography>
                    </ListItemText>
               </ListItem>
               <ListItem>
               <ListItemIcon>
                         <ArrowRightIcon/>
               </ListItemIcon>
                    <ListItemText>
                    <Typography >Communicate With Professional Team</Typography>
                    </ListItemText>
               </ListItem>
          </List>

    <Typography gutterBottom> Phone Number: 9999004262</Typography>
</ThemeProvider>

     </Grid>
     <Grid item xs={6} >
     <Container maxWidth="sm" style={{ backgroundColor: 'white',padding:'30px' }}>


     <ContactForm/>

</Container>       
     </Grid>
</Grid>


            <Footer />

        </div>



	);
}

export default Contact;
